import "./Home.css";

const Home = () => {
  return (
    <div className="backgroundHome">
      <div className="bannerHome" id="landing">
        Resort
      </div>
      <div className="homeP">
        <p className="poolText">
          If you are not feeling in the right mood to go outside <br /> you can just
          stay here in the resort <br /> and relax by the pool
        </p>
        <p className="sportText">or maybe play some tennis <br /> or football.</p>
        <p className="acText">
          maybe you just want some fresh air <br /> so staying inside with the AC on <br />
          suits your case best.
        </p>
      </div>
    </div>
  );
};

export default Home;
